import React from "react";
import FilterVintageIcon from '@mui/icons-material/FilterVintage';
import Time from "./Time"


function Header() {

  return (
   <div> <header> 
       <Time style={{color: "white"}}/>
      <h1>
      
        <FilterVintageIcon 
        className="icon" 
        fontSize="large" />
        <FilterVintageIcon 
        className="icon" 
        fontSize="medium"/> 
        Save a note
        <FilterVintageIcon 
        className="icon"  
        fontSize="medium"/>
        <FilterVintageIcon 
        className="icon" 
        fontSize="large"/>
      </h1>
    </header></div>
  );
}

export default Header;
